    "Fish Creek Federally Endangered Freshwater Mussel Impact Assessment",nt"tracking_summary":
    {ntt"total": 23,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:42:05.350245",nt"name": "fish-creek-federally-endangered-freshwater-mussel-impact-assessment",nt"isopen":
    false,nt"url": null,nt"notes": "Sediment toxicity was evaluated for one
    site upstream and three sites downstream of a diesel fuel spill that occurred in
    Fish Creek (OH and IN) in September 1993 using glochidia and juvenile unionid mussels.
    This fourth order tributary of the St. Joseph River has the only known remaining
    population of white cat's paw pearly mussel, Epioblasma obliquata perobliqua, and
    populations of several other federal and state endangered mussels. The impact of
    the oil spill was of great concern because of the potential long term threat it
    poses to the survival of these mussels. Sediment samples collected two years after
    the spill contained low heavy metal concentrations, and detectable, but not quantifiable
    levels of organic components of diesel fuel. These levels coincided with their lack
    of toxicity to juvenile Villosa villosa and Lampsilis radiata luteola mussels, and
    the amphipod Hyalella azteca after 9-day exposures. Fish Creek sediments may be
    toxic to L. r. luteola glochidia.",nt"license_title": "License Not Specified",nt"extras":
